Alfalfa Electric Cooperative
May 11 at 7:00 PM ·

AEC presented Youth Tour Awards at a banquet held in March.
COVID -19 has canceled all trips for the students, but they all
received $500. Joseph Alcuitas, Kremlin-Hillsdale; Emily Barton, Alva;
Callista Studer, Cherokee; Summer Finney, Timberlake;
Madison Rhodes, Freedom; John Rose, Kremlin-Hillsdale;
(not pictured) Ana Smith, Medicine Lodge KS.

